import styled from 'styled-components';

export const HomePageContainer = styled.div`
	display: flex;
	align-items: center;
	padding: 20px 80px;
`;

export const DirectoryMenu = styled.div`
	width: 100%;
	display: flex;
	flex-flow: row wrap;
	margin-left: -8px;
	width: 100%;
`;
